function UserList() {
    const users = [
        {
            name:"Amit",
            salary:20000
        },
        {
            name:"Dan",
            salary:"30000"
        }
    ];

    return (
        <div>
            {users.map((user) => {
                return <div>
                        <label>{user.name}</label>
                        <p>{user.salary}</p>
                    </div>
            }) }
        </div>
    )
}

export default UserList;
